PREFIX std223: <http://data.ashrae.org/standard223#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?zone ?zoneLabel ?prop ?propLabel WHERE {
  ?zone a std223:Zone .
  {
    # Direct property association
    ?zone std223:hasProperty ?prop .
  } UNION {
    # Indirect association via a RoomDomainSpace reachable through containment/ enclosure/ domain links
    ?zone (std223:contains|std223:encloses|std223:hasDomainSpace)+ ?room .
    ?room a std223:RoomDomainSpace .
    ?room std223:hasProperty ?prop .
  }
  OPTIONAL { ?zone rdfs:label ?zoneLabel . }
  OPTIONAL { ?prop rdfs:label ?propLabel . }
}
ORDER BY ?zone

